// @mui icons
import FacebookIcon from "@mui/icons-material/Facebook";
import TwitterIcon from "@mui/icons-material/Twitter";
// import GitHubIcon from "@mui/icons-material/GitHub";
// import YouTubeIcon from "@mui/icons-material/YouTube";

// Material Kit 2 React components
import MKTypography from "components/MKTypography";

// Images
import logoCT from "assets/images/logos/gray-logos/logols4.png";

const date = new Date().getFullYear();

export default {
  brand: {
    name: "Servicio Médico Empresarial LS",
    image: logoCT,
    route: "/",
  },
  socials: [
    {
      icon: <FacebookIcon />,
      link: "https://www.facebook.com/profile.php?id=100064278240012&mibextid=ZbWKwL",
    },
    {
      icon: <TwitterIcon />,
      link: "https://twitter.com",
    },
  ],
  menus: [
    {
      name: "¿Quienes Somos?",
      items: [
        { name: "Nosotros", href: "/nosotros" },
        { name: "Misión y visión", href: "/nosotros" },
        { name: "Datos generales", href: "/nosotros" },



      ],
    },
    {
      name: "Nuestros servicios",
      items: [
        { name: "Lista de servicios básicos", href: "/" },
        { name: "Servicios adicionales", href: "/" },
        { name: "Campaña de salud en tu empresa", href: "/" },
      ],
    },
    {
      name: "Convenios y acuerdos",
      items: [
        { name: "Convenios", href: "/convenios" },

      ],
    },
    {
      name: "Documentos y Regulaciones",
      items: [
        { name: "Marco Legal", href: "https://www.creative-tim.com/terms" },
        { name: "Normas y reglamentos mexicanos en salud laboral", href: "https://www.creative-tim.com/privacy" },
        { name: "Reglamento federal", href: "https://www.creative-tim.com/license" }, 
      ],
    },
  ],
  copyright: (
    <MKTypography variant="button" fontWeight="regular">
      Derechos Reservados Copyright &copy; {date} SIAC{" "}
      <MKTypography
        component="a"
        href="https://www.creative-tim.com"
        target="_blank"
        rel="noreferrer"
        variant="button"
        fontWeight="regular"
      >
        Desarrollos
      </MKTypography>
      .
    </MKTypography>
  ),
};
